import React from 'react';
import './index.css';
import Cards from "./Project1/Cards";
import sData from  './Project1/cardLists';



    const App = ()=>{

        

        return (
            <>
            <h1 className='heading1'>Top Five MxPlayer Series</h1>

              <Cards  key={sData[3].key} 
                      srcImage={val.srcImage} 
                      title={val.title} 
                      typeTrend={val.typeTrend}
                      />

            </>
        )
    }

    export default App;
